import React, { Component } from 'react'

export default class App extends Component {
  constructor(){
    super()
    this.state = {
      count:1
    }
  }

  render() {
    const h11 = {
      display:"grid",
      margin:"auto",
      position:"fixed",
      top:"250px",
      textAlign:"center"
    }
    return (
      <div>
        <h1 style={h11}>{this.state.count}</h1>
      </div>
    )
  }
}
